import React, { useState } from 'react'
import Chat from './components/Chat';
import Room from './components/Room';
// import './App.css';

function App(){
  const [room, setRoom] = useState({
    'roomId' : '',
    'sender' : 'guest'
  })
  return (
    <div>
      <Room setRoom={setRoom}/>
      <Chat roomId={room.roomId} sender={room.sender}/>
    </div>
  )

}

export default App
